import React from 'react';
import { Scatter } from 'react-chartjs-2';

const StatusChart = () => {
  // Sample data for the scatter chart
  const data = {
    datasets: [
      {
        label: 'Scatter Chart Example',
        data: [
          { x: 10, y: 20 },
          { x: 15, y: 35 },
          { x: 23, y: 15 },
          { x: 40, y: 40 },
          { x: 50, y: 30 },
        ],
        backgroundColor: 'rgba(75,192,192,0.6)',
      },
    ],
  };

  // Optional chart options
  const options = {
    scales: {
      x: {
        type: 'linear',
        position: 'bottom',
      },
      y: {
        type: 'linear',
        position: 'left',
      },
    },
  };

  return (
    <div>
      <Scatter data={data} options={options} />
    </div>
  );
};

export default StatusChart;
